e","path":"scripts/Update-TeamsLicense","contentType":"directory"},{"name":"get-siteinventory","path":"scripts/get-siteinventory","contentType":"directory"},{"name":"get-teamsusage","path":"scripts/get-teamsusage","contentType":"directory"},{"name":"move-team","path":"scripts/move-team","contentType":"directory"},{"name":"split-spmtlogerrors","path":"scripts/split-spmtlogerrors","contentType":"directory"}],"totalCount":39},"":{"items":[{"name":".github","path":".github","contentType":"directory"},{"name":"samples","path":"samples","contentType":"directory"},{"name":"scripts","path":"scripts","contentType":"directory"},{"name":"tools","path":"tools","contentType":"directory"},{"name":".gitignore","path":".gitignore","contentType":"file"},{"name":"CHANGELOG.md","path":"CHANGELOG.md","contentType":"file"},{"name":"CONTRIBUTING.md","path":"CONTRIBUTING.md","contentType":"file"},{"name":"LICENSE","path":"LICENSE","contentType":"file"},{"name":"LICENSE-CODE","path":"LICENSE-CODE","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"},{"name":"SECURITY.MD","path":"SECURITY.MD","contentType":"file"},{"name":"TEMPLATE-README.md","path":"TEMPLATE-README.md","contentType":"file"}],"totalCount":12}},"fileTreeProcessingTime":11.273679999999999,"foldersToFetch":[],"reducedMotionEnabled":null,"repo":{"id":123931959,"defaultBranch":"master","name":"FastTrack","ownerLogin":"microsoft","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2018-03-05T14:31:58.000Z","ownerAvatar":"https://avatars.githubusercontent.com/u/6154722?v=4","public":true,"private":false,"isOrgOwned":true},"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"master","listCacheKey":"v0:1698673867.0","canEdit":false,"refType":"branch","currentOid":"07e965b0b98f8843b60ca211e6579afd3947921c"},"path":"scripts/Find-MailboxDelegates/Find-MailboxDelegates.ps1","currentUser":null,"blob":{"rawLines":["﻿\u003c#",".DESCRIPTION","","###############Disclaimer#####################################################","The sample scripts are not supported under any Microsoft standard support ","program or service. The sample scripts are provided AS IS without warranty  ","of any kind. Microsoft further disclaims all implied warranties including,  ","without limitation, any implied warranties of merchantability or of fitness for ","a particular purpose. The entire risk arising out of the use or performance of  ","the sample scripts and documentation remains with you. In no event shall ","Microsoft, its authors, or anyone else involved in the creation, production, or ","delivery of the scripts be liable for any damages whatsoever (including, ","without limitation, damages for loss of business profits, business interruption, ","loss of business information, or other pecuniary loss) arising out of the use ","of or inability to use the sample scripts or documentation, even if Microsoft ","has been advised of the possibility of such damages.","###############Disclaimer#####################################################","","We have developed this script because cross premises permissions are not supported with Exchange Hybrid environments: https://technet.microsoft.com/en-us/library/jj906433(v=exchg.150).aspx.","With this script you can export Exchange 2010/2013 on premises permissions, find their associated delegates, and produce a report of mailboxes with their recommended batch to minimize impact to those users.   ","","Requirement: Active Directory Module","","Steps performed by the script: "," ","    1)Collect permissions ","    2)Find batches based on the output permissions","    3)Create Migration schedule (this is built in the format required by the Microsoft FastTrack Mail Migration team).","","*For extra large environments with many mailboxes, you may consider running multiple instances of the script. For example: ","    1)Create multiple csv files that has different emails each. The number of csv files depends on the number of powershell sessions you will have going in parallel.","    2)Spin up multiple powershell sessions and run the script pointed at different InputMailboxesCSV files","    3)Merge the permissions output files from each script into one singular permissions file","    4)Run one of the scripts with the -BatchUsers - this will bypass collecting permissions and jump straight into batching users using the permissinos output in the same directory as the script  ","","=========================================","Version: ","    12062019: Add Permissions Only switch to skip steps 2 \u0026 3","    08232019: AccountResourceEnv switch add ","    05012019: Update cross domain check","\t06262018: Update group enumeration cross domain logic","    06122018: Update group enumeration logic","","Authors: ","Alejandro Lopez - alejanl@microsoft.com","Sam Portelli - Sam.Portelli@microsoft.com","","Contributors:","Francesco Poli - Francesco.Poli@microsoft.com","=========================================","",".PARAMETER InputMailboxesCSV","Use this parameter to specify a list of users to collect permissions for, rather than all mailboxes.","Make sure that the CSV file provided has a header titled \"PrimarySMTPAddress\"","",".PARAMETER ExcludeServiceAcctsCSV","In cases where you have service accounts with permissions to a large number of mailboxes, e.g. Blackberry service accounts, you can use this to exclude those accounts from the batching processing. ","Provide the path to a csv file (no header needed) with each service account primarySMTPaddress on its own line. "," ","*This will slow down processing. ","",".PARAMETER FullAccess","Collect Full Access permissions. Keep in mind that \"Full Access\" permissions are now supported in cross premises scenarios. Not including \"Full Access\" will speed up processing. ","",".PARAMETER SendOnBehalfTo","Collect SendOnBehalfTo permissions","",".PARAMETER Calendar","Collect calendar permissions","",".PARAMETER SendAs","Collect Send As permissions","",".PARAMETER EnumerateGroups","This will enumerate groups that have permissions to mailboxes and include in the batching logic.","","*This will slow down processing.","",".PARAMETER ExcludeGroupsCSV","Use this to exclude groups that you don't want to enumerate. Provide the path to a csv file (no header needed) with each group name on its own line. ","",".PARAMETER ExchServerFQDN","Connect to a specific Exchange Server","",".PARAMETER Resume","Use this to resume the script in case of a failure while running the script on a large number of users. This way you don't have to start all over.","The way this works is that it will look for the progress xml file where it keeps track of mailboxes that are pending processing.","Make sure not to use in conjunction with the InputMailboxesCSV switch.","",".PARAMETER BatchUsers","Use this if you want to skip collecting permissions and only run Step 2 and Step 3. ","Make sure you have the permissions output file in the same directory (Find-MailboxDelegates-Permissions.csv).","",".PARAMETER BatchUsersOnly","Use this if you want to skip collecting permissions (step1) and creating a migration schedule (step 3). This won't require an active exchange session, but make sure you have the permissions output file in the same directory (Find-MailboxDelegates-Permissions.csv).","",".PARAMETER GetPermissionsOnly","Use this switch to run Step 1 only (Get Permissions). This will skip steps 2\u00263 which does the spider web batching and creates a migration schedule. ","",".PARAMETER AccountResourceEnv","Switch to run the script taking into account an Account/Resource environment","",".EXAMPLE","#Export only SendOnBehalfTo and Send As permissions and Enumerate Groups for all mailboxes.  ",".\\Find-MailboxDelegates.ps1 -SendOnBehalfTo -SendAs -EnumerateGroups","",".EXAMPLE","#Export only Full Access and Send As permissions and Enumerate Groups for the provided user list. Make sure to use \"PrimarySMTPAddress\" as header. ",".\\Find-MailboxDelegates.ps1 -InputMailboxesCSV \"C:\\Users\\administrator\\Desktop\\userlist.csv\" -FullAccess -SendAs -EnumerateGroups","",".EXAMPLE","#Resume the script after a script interruption and failure to pick up on where it left off. Make sure to include the same switches as before EXCEPT the InputMailboxesCSV otherwise it'll yell at you",".\\Find-MailboxDelegates.ps1 -FullAccess -SendAs -EnumerateGroups -Resume","",".EXAMPLE","#Export all permissions and enumerate groups for all mailboxes",".\\Find-MailboxDelegates.ps1 -FullAccess -SendOnBehalfTo -SendAs -Calendar -EnumerateGroups ","",".EXAMPLE","#Export all permissions but don't enumerate groups for all mailboxes",".\\Find-MailboxDelegates.ps1 -FullAccess -SendOnBehalfTo -SendAs -Calendar","",".EXAMPLE","#Export all permissions and exclude service accounts for all mailboxes",".\\Find-MailboxDelegates.ps1 -FullAccess -SendOnBehalfTo -SendAs -Calendar -ExcludeServiceAcctsCSV \"c:\\serviceaccts.csv\" ","",".EXAMPLE","#Export all permissions and exclude service accounts for all mailboxes",".\\Find-MailboxDelegates.ps1 -FullAccess -SendOnBehalfTo -SendAs -Calendar -ExcludeServiceAcctsCSV \"c:\\serviceaccts.csv\" -ExcludeGroupsCSV \"c:\\groups.csv\"","",".EXAMPLE","#Skip collect permissions (assumes you already have a permissions output file) and only run Step 2 to batch users","",".\\Find-MailboxDelegates.ps1 -BatchUsersOnly","",".EXAMPLE","#Skip collect permissions (assumes you already have a permissions output file) and only run Step 2 and 3 to batch users and creation migration schedule file",".\\Find-MailboxDelegates.ps1 -BatchUsers","","#\u003e","","param(","    [string]$InputMailboxesCSV,","    [switch]$FullAccess,","    [switch]$SendOnBehalfTo,","    [switch]$Calendar,","    [switch]$SendAs,","    [switch]$EnumerateGroups,","    [string]$ExcludeServiceAcctsCSV,","    [string]$ExcludeGroupsCSV,","    [string]$ExchServerFQDN,","    [switch]$Resume,","    [switch]$BatchUsers, ","    [switch]$BatchUsersOnly,","    [switch]$GetPermissionsOnly, ","    [switch]$AccountResourceEnv",")","","Begin{","    try{","","        #region functions","        Function Write-LogEntry {","               param(","                  [string] $LogName ,","                  [string] $LogEntryText,","                  [string] $ForegroundColor","               )","               if ($LogName -NotLike $Null) {","                  # log the date and time in the text file along with the data passed","                  \"$([DateTime]::Now.ToShortDateString()) $([DateTime]::Now.ToShortTimeString()) : $LogEntryText\" | Out-File -FilePath $LogName -append;","                  if ($ForeGroundColor -NotLike $null) {","                     # for testing i pass the ForegroundColor parameter to act as a switch to also write to the shell console","                     write-host $LogEntryText -ForegroundColor $ForeGroundColor","                  }","               }","            }","","        \u003c# Get-RecipientCustom","            Perform a fail safe Get-Recipient to handle resource forest model where the users permissions are assigned to domain\\user in the account","            forest, that is not resolvable in the Resource domain. Upon get-recipient failure it will try to find a mailbox with the linkedMasterAccount","            associate, and use it as reference for batch grouping","        #\u003e","        Function Get-RecipientCustom{","            param(","                [string]$recipient","            )","            $error.Clear()","            try","            { ","                $del=Get-Recipient -Identity $recipient -ErrorAction stop","            }","            catch ","            {","                if ( $error[0].Exception.ToString() -like \"*The operation couldn't be performed because object*couldn't be found on*\")","                {","                   $external = $Script:mailboxesLookup | where {$_.linkedmasteraccount -eq $recipient}","","                   if ($external) {","                        $del = Get-Recipient -Identity $external.identity.tostring() -ErrorAction silentlyContinue","                        if ($del) ","                        {","                            $error.Clear()","                            return $del","                        }","                        else ","                        { ","                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found external linked account $recipient associated to $($external.identity) mailbox, but cannot get the Recipient property\"","                            return $null","                        }","                   }","                   Else","                   {","                        Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Unable to find Mailbox with LinkedMasterAccount associated to $recipient\" ","                        return $null","                   }","                }","        ","            }","            return $del","        }","","        Function Get-GroupCustom{","            param(","                [string]$Identity","            )","            $error.Clear()","            try","            { ","                #$del=Get-Group -Identity $group -ErrorAction stop","                $group = Get-Group -identity $Identity -ErrorAction SilentlyContinue","            }","            catch ","            {","                if ( $error[0].Exception.ToString() -like \"*The operation couldn't be performed because object*couldn't be found on*\")","                {","                    $domain = $Identity.split(\"\\\")[0]","                    $remoteDC = Get-ADDomainController -discover -domain $domain ","                    try{","                        $group = get-group -identity $Identity -DomainController $remoteDC.hostname -erroraction silentlyContinue","                        return $group","                    }","                    catch{","                        return $null","                    }","                }","            }","            return $group","        }","","        Function Get-Permissions(){","\t            param(","                    [string]$UserEmail,","                    [bool]$gatherfullaccess,","                    [bool]$gatherSendOnBehalfTo,","                    [bool]$gathercalendar,","                    [bool]$gathersendas,","                    [bool]$EnumerateGroups,","                    [string[]]$ExcludedGroups,","                    [string[]]$ExcludedServiceAccts","                )","","                try{","                    ","","                    #Variables","                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Get Permissions for: $($UserEmail)\"","                    $CollectPermissions = New-Object System.Collections.Generic.List[System.Object] ","                    $Error.Clear()","                    $Mailbox = Get-mailbox $UserEmail -EA SilentlyContinue","                    If(!$Mailbox){","                        throw \"Problem getting mailbox for $($UserEmail) : $($error)\" ","                    }","                    $globalCatalog = ([System.DirectoryServices.ActiveDirectory.Forest]::GetCurrentForest().GlobalCatalogs | Select-Object -First 1 -ExpandProperty Name) + \":3268\"","","                    #Enumerate Groups/Send As - moving this part outside of the function for faster processing","                    \u003c#","                    If(($EnumerateGroups -eq $true) -or ($gathersendas -eq $true)){","                        $dse = [ADSI]\"LDAP://Rootdse\"","                        $ext = [ADSI](\"LDAP://CN=Extended-Rights,\" + $dse.ConfigurationNamingContext)","                        $dn = [ADSI]\"LDAP://$($dse.DefaultNamingContext)\"","                        $dsLookFor = new-object System.DirectoryServices.DirectorySearcher($dn)","","                        $permission = \"Send As\"","                        $right = $ext.psbase.Children | ? { $_.DisplayName -eq $permission }","                    }","                    #\u003e","            ","                    If($gathercalendar -eq $true){","                        $Error.Clear()","","\t                    $calFolder = Get-MailboxFolderStatistics -Identity $Mailbox.alias -FolderScope Calendar | Where-Object {$_.FolderType -eq 'Calendar' -and -not $_.Movable } | Select-Object Name, FolderId","\t                    $CalendarPermission = Get-MailboxFolderPermission -Identity ('{0}:{1}' -f $Mailbox.Alias, $calFolder.FolderId) -WarningAction SilentlyContinue -ErrorAction SilentlyContinue | ?{$_.User -notlike \"Anonymous\" -and $_.User -notlike \"Default\"} | Select User, AccessRights","            ","                        If($CalendarPermission){","                            Foreach($perm in $CalendarPermission){","                                #$ifGroup = Get-Group -identity $perm.user.tostring() -ErrorAction SilentlyContinue","                                $ifGroup = Get-GroupCustom -identity $perm.user.tostring() -ErrorAction SilentlyContinue","                                If($ifGroup){","                                    If($EnumerateGroups -eq $true){","\t\t\t\t                        If(-not ($excludedGroups -contains $ifGroup.Name)){","                                            $groupDomainName = $ifgroup.identity.tostring().split(\"/\")[0]","                                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : Calendar : Enumerate Group $($ifGroup.distinguishedName) Domain Name: $groupDomainName\"","                                            #$lstUsr = Get-AdGroup -identity $ifGroup.Name -Server $groupDomainName | Get-ADGroupMember -Recursive | Get-ADUser -Properties Mail","                                            $lstUsr = Get-ADGroupMember -identity $ifGroup.distinguishedName -server $groupDomainName -Recursive | Get-ADUser -Properties Mail | ?{$_.Mail}","","\t                                        foreach ($usrTmp in $lstUsr) {","                                                $usrTmpEmail = $usrTmp.Mail","                                                If($ExcludedServiceAccts){","                                                    if(-not ($ExcludedServiceAccts -contains $usrTmpEmail -or $ExcludedServiceAccts -contains $mailbox.primarySMTPAddress.ToString())){","                                                        Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : CalendarFolder : $($usrTmpEmail)\"","                                                        $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $usrTmpEmail; AccessRights = \"Calendar Folder\"})","                                                    }","                                                }","                                                Else{","                                                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : CalendarFolder : $($usrTmpEmail)\"","                                                    $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $usrTmpEmail; AccessRights = \"Calendar Folder\"})","                                                }","\t                                        }","\t\t\t\t                        }","                                    }","                                }","                                Else{","                                    If($perm.user.adrecipient.primarysmtpaddress -ne $null){                               ","                                        $delegate = Get-RecipientCustom $perm.user.adrecipient.primarysmtpaddress.tostring().replace(\":\\Calendar\",\"\")","","                                        If($mailbox.primarySMTPAddress -and $delegate.primarySMTPAddress){","                                            If(-not ($mailbox.primarySMTPAddress.ToString() -eq $delegate.primarySMTPAddress.ToString())){","                                                If($ExcludedServiceAccts){","                                                    if(-not ($ExcludedServiceAccts -contains $delegate.primarySMTPAddress.tostring() -or $ExcludedServiceAccts -contains $mailbox.primarySMTPAddress.ToString())){","                                                        Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : CalendarFolder : $($delegate.primarySMTPAddress.ToString())\"","                                                        $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $delegate.primarySMTPAddress.ToString(); AccessRights = \"Calendar Folder\"})","                                                    }","                                                }","                                                Else{","                                                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : CalendarFolder : $($delegate.primarySMTPAddress.ToString())\"","                                                    $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $delegate.primarySMTPAddress.ToString(); AccessRights = \"Calendar Folder\"})","                                                }","                                            }","                                        }","                                    }","                                }","                            }","                        }","                        If($Error){","                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"MBX=$($Mailbox.PrimarySMTPAddress) PERM=CalendarFolder ERROR=$($error[0].ToString()) POSITION=$($error[0].InvocationInfo.PositionMessage)\"","                        }","                    }","","                    If($gatherfullaccess -eq $true){","                        $Error.Clear()","                        $FullAccessPermissions = Get-MailboxPermission -Identity ($Mailbox.PrimarySMTPAddress).tostring() | ? {($_.AccessRights -like \"*FullAccess*\") -and ($_.IsInherited -eq $false) -and ($_.User -notlike $NTAuthoritySelf) -and ($_.User -notlike \"S-1-5*\") -and ($_.User -notlike $Mailbox.PrimarySMTPAddress)}","                ","                        If($FullAccessPermissions){","                            Foreach($perm in $FullAccessPermissions){","                                #$ifGroup = Get-Group -identity $perm.user.tostring() -ErrorAction SilentlyContinue ","                                $ifGroup = Get-GroupCustom -identity $perm.user.tostring() -ErrorAction SilentlyContinue","                                If($ifGroup){","                                    If($EnumerateGroups -eq $true){","\t\t\t\t                        If(-not ($excludedGroups -contains $ifGroup.Name)){","                                            $groupDomainName = $ifgroup.identity.tostring().split(\"/\")[0]","                                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : FullAccess : Enumerate Group $($ifGroup.distinguishedName) Domain Name: $groupDomainName\"","                                            #$lstUsr = Get-AdGroup -identity $ifGroup.distinguishedName | Get-ADGroupMember -Recursive | Get-ADUser -Properties Mail $globalCatalog","                                            $lstUsr = Get-ADGroupMember -identity $ifGroup.distinguishedName -server $groupDomainName -Recursive | Get-ADUser -Properties Mail | ?{$_.Mail}","","\t                                        foreach ($usrTmp in $lstUsr) {","                                                $usrTmpEmail = $usrTmp.Mail","                                                If($ExcludedServiceAccts){","                                                    if(-not ($ExcludedServiceAccts -contains $usrTmpEmail -or $ExcludedServiceAccts -contains $mailbox.primarySMTPAddress.ToString())){","                                                        Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : FullAccess : $($usrTmpEmail)\"","                                                        $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $usrTmpEmail; AccessRights = \"Full Access\"})","                                                    }","                                                }","                                                Else{","                                                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : FullAccess : $($usrTmpEmail)\"","                                                    $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $usrTmpEmail; AccessRights = \"Full Access\"})","                                                }","\t                                        }","\t\t\t\t                        }","                                    }","                                }","                                Else{","                                    #$delegate = Get-Recipient -Identity $perm.user.tostring() -ErrorAction SilentlyContinue","                                    $delegate = Get-RecipientCustom $perm.user.tostring()","                        ","                                    If($mailbox.primarySMTPAddress -and $delegate.primarySMTPAddress){","\t\t\t\t\t\t\t            If(-not ($mailbox.primarySMTPAddress.ToString() -eq $delegate.primarySMTPAddress.ToString())){","                                            If($ExcludedServiceAccts){","                                                if(-not ($ExcludedServiceAccts -contains $delegate.primarySMTPAddress.tostring() -or $ExcludedServiceAccts -contains $mailbox.primarySMTPAddress.ToString())){","                                                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : FullAccess : $($delegate.primarySMTPAddress.ToString())\"","                                                    $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $delegate.primarySMTPAddress.ToString(); AccessRights = \"Full Access\"})","                                                }","                                            }","                                            Else{","                                                Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : FullAccess : $($delegate.primarySMTPAddress.ToString())\"","                                                $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $delegate.primarySMTPAddress.ToString(); AccessRights = \"Full Access\"})","                                            }","                                        }","                                    }","                                }","                            }","                        }","","                        If($Error){","                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"MBX=$($Mailbox.PrimarySMTPAddress) PERM=FullAccess ERROR=$($error[0].ToString()) POSITION=$($error[0].InvocationInfo.PositionMessage)\"","                        }","                    }","","                    If($gathersendas -eq $true){","                        $Error.Clear()","                        #$SendAsPermissions = Get-ADPermission $Mailbox.DistinguishedName | ?{($_.ExtendedRights -like \"*send-as*\") -and ($_.IsInherited -eq $false) -and -not ($_.User -like $NTAuthoritySelf) }","                ","                        $SendAsPermissions = New-Object System.Collections.Generic.List[System.Object] ","                        $userDN = [ADSI](\"LDAP://$($mailbox.DistinguishedName)\")","                        $userDN.psbase.ObjectSecurity.Access | ? { ($_.ObjectType -eq [GUID]$right.RightsGuid.Value) -and ($_.IsInherited -eq $false) } | select -ExpandProperty identityreference | %{","\t\t\t\t            If(-not ($_ -like $NTAuthoritySelf)){","\t\t\t\t\t            $SendAsPermissions.add($_)","\t\t\t\t            }","\t\t\t            }","                ","","                        If($SendAsPermissions){","                            Foreach($perm in $SendAsPermissions){","                                #$ifGroup = Get-Group -identity $perm.tostring() -ErrorAction SilentlyContinue","                                $ifGroup = Get-GroupCustom -identity $perm.tostring() -ErrorAction SilentlyContinue","                                If($ifGroup){","                                    If($EnumerateGroups -eq $true){","\t\t\t\t                        If(-not ($ExcludedGroups -contains $ifGroup.Name)){","                                            $groupDomainName = $ifgroup.identity.tostring().split(\"/\")[0]","                                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : SendAs : Enumerate Group $($ifGroup.distinguishedName) Domain Name: $groupDomainName\"","                                            #$lstUsr = Get-AdGroup -identity $ifGroup.distinguishedName -Server $groupDomainName | Get-ADGroupMember -Recursive | Get-ADUser -Properties Mail -server $globalCatalog","                                            $lstUsr = Get-ADGroupMember -identity $ifGroup.distinguishedName -server $groupDomainName -Recursive | Get-ADUser -Properties Mail | ?{$_.Mail}","","\t                                        foreach ($usrTmp in $lstUsr) {","                                                $usrTmpEmail = $usrTmp.Mail","                                                If($ExcludedServiceAccts){","                                                    if(-not ($ExcludedServiceAccts -contains $usrTmpEmail -or $ExcludedServiceAccts -contains $mailbox.primarySMTPAddress.ToString())){","                                                        Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : SendAs : $($usrTmpEmail)\"","                                                        $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $usrTmpEmail; AccessRights = \"Send As\"})","                                                    }","                                                }","                                                Else{","                                                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : SendAs : $($usrTmpEmail)\"","                                                    $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $usrTmpEmail; AccessRights = \"Send As\"})","                                                }","\t                                        }","\t\t\t\t                        }","                                    }","                                }","                                Else{","                                    #$delegate = Get-Recipient -Identity $perm.tostring() -ErrorAction SilentlyContinue","                                    $delegate = Get-RecipientCustom $perm.tostring()","                        ","                                    If($mailbox.primarySMTPAddress -and $delegate.primarySMTPAddress){","\t\t\t\t\t\t\t            If(-not ($mailbox.primarySMTPAddress.ToString() -eq $delegate.primarySMTPAddress.ToString())){","\t\t\t\t\t\t\t\t            If($ExcludedServiceAccts){","                                                if(-not ($ExcludedServiceAccts -contains $delegate.primarySMTPAddress.tostring() -or $ExcludedServiceAccts -contains $mailbox.primarySMTPAddress.ToString())){","                                                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : SendAs : $($delegate.primarySMTPAddress.ToString())\"","                                                    $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $delegate.primarySMTPAddress.ToString(); AccessRights = \"Send As\"})","                                                }","                                            }","                                            Else{","                                                Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : SendAs : $($delegate.primarySMTPAddress.ToString())\"","                                                $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $delegate.primarySMTPAddress.ToString(); AccessRights = \"Send As\"})","                                            }","                                        }","                                    }","                                }","                            }    ","                        }","","                        If($Error){","                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"MBX=$($Mailbox.PrimarySMTPAddress) PERM=SendAs ERROR=$($error[0].ToString()) POSITION=$($error[0].InvocationInfo.PositionMessage)\"","                        }","                    }","","                    If($gatherSendOnBehalfTo -eq $true){","                        $Error.Clear()","                        $GrantSendOnBehalfToPermissions = $Mailbox.grantsendonbehalfto.ToArray()","","                        If($GrantSendOnBehalfToPermissions){","                            Foreach($perm in $GrantSendOnBehalfToPermissions){","                                #$delegate = Get-Recipient -Identity $perm.tostring() -ErrorAction SilentlyContinue","                                $delegate = Get-RecipientCustom $perm.tostring()","                        ","                                If($mailbox.primarySMTPAddress -and $delegate.primarySMTPAddress){","\t\t\t\t\t\t\t        If(-not ($mailbox.primarySMTPAddress.ToString() -eq $delegate.primarySMTPAddress.ToString())){","                                        If($ExcludedServiceAccts){","                                            if(-not ($ExcludedServiceAccts -contains $delegate.primarySMTPAddress.tostring() -or $ExcludedServiceAccts -contains $mailbox.primarySMTPAddress.ToString())){","                                                Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : SendOnBehalfTo : $($delegate.primarySMTPAddress.ToString())\"","                                                $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $delegate.primarySMTPAddress.ToString(); AccessRights = \"SendOnBehalfTo\"})","                                            }","                                        }","                                        Else{","                                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Found permission : SendOnBehalfTo : $($delegate.primarySMTPAddress.ToString())\"","                                            $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = $delegate.primarySMTPAddress.ToString(); AccessRights = \"SendOnBehalfTo\"})","                                        }","                                    }","                                }","                            }","                        }","                        ","                        If($Error){","                            Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"MBX=$($Mailbox.PrimarySMTPAddress) PERM=SendOnBehalfTo ERROR=$($error[0].ToString()) POSITION=$($error[0].InvocationInfo.PositionMessage)\"","                        }","                    }","                    ","                    ","                    ","                    If($CollectPermissions.Count -eq 0){","                        #write progress to xml file","                        $updateXML = [System.Xml.XmlDocument](Get-Content $ProgressXMLFile)","                        $node = $updateXML.Mailboxes.Mailbox | ?{$_.Name -eq $Mailbox.PrimarySMTPAddress}","                        If($node -ne $null){","                            $node.Progress = \"Completed\"","                        }","                        $updateXML.save($ProgressXMLFile)","                        $CollectPermissions.add([pscustomobject]@{Mailbox = $Mailbox.PrimarySMTPAddress; User = \"None\"; AccessRights = \"None\"})","                        Return $CollectPermissions","                    }","                    else{","                        #write progress to xml file","                        $updateXML = [System.Xml.XmlDocument](Get-Content $ProgressXMLFile)","                        $node = $updateXML.Mailboxes.Mailbox | ?{$_.Name -eq $Mailbox.PrimarySMTPAddress}","                        If($node -ne $null){","                            $node.Progress = \"Completed\"","                        }","                        $updateXML.save($ProgressXMLFile)","                        Return $CollectPermissions","                    }","                }","                catch{","                    $updateXML = [System.Xml.XmlDocument](Get-Content $ProgressXMLFile)","                    $node = $updateXML.Mailboxes.Mailbox | ?{$_.Name -eq $UserEmail}","                    If($node -ne $null){","                        $node.Progress = \"Failed\"","                    }","                    $updateXML.save($ProgressXMLFile)","                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"MBX=$($UserEmail) ERROR=$($_.exception.message) POSITION=$($_.InvocationInfo.Line) $($_.InvocationInfo.PositionMessage)\"","                }","            }","","        Function ConnectTo-Exchange ($ExchServerFQDN) {","            #Connect to Exchange","            if (Test-Path $env:ExchangeInst