h = @{}","                $batchNum = 0","                $hashDataSize = $hashData.Count","                $yyyyMMdd = Get-Date -Format 'yyyyMMdd'","\t","                try{","                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Build ArrayList for users with no dependents\"","                    If($hashDataByDelegate[\"None\"].count -gt 0){","\t\t                $hashDataByDelegate[\"None\"] | %{$_.Mailbox} | %{[void]$usersWithNoDependents.Add($_)}","\t                }\t    ","","                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Identify users with no permissions on them, nor them have perms on another\" ","\t                If($usersWithNoDependents.count -gt 0){","\t\t                $($usersWithNoDependents) | %{","\t\t\t                if($hashDataByDelegate.ContainsKey($_)){","\t\t\t\t                $usersWithNoDependents.Remove($_)","\t\t\t                }\t","\t\t                }","            ","                        Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Remove users with no dependents from hash\" ","\t\t                $usersWithNoDependents | %{$hashData.Remove($_)}","\t\t                #Clean out hashData of users in hash data with no delegates, otherwise they'll get batched","                        Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Clean out hashData of users in hash with no delegates\"  ","\t\t                foreach($key in $($hashData.keys)){","                                if(($hashData[$key] | select -expandproperty user ) -eq \"None\"){","\t\t\t\t                $hashData.Remove($key)","\t\t\t                }","\t\t                }","\t                }","                    #Execute batch functions","                    If(($hashData.count -ne 0) -or ($usersWithNoDependents.count -ne 0)){","                        Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Run function: Find-Links\" -ForegroundColor White  ","                      