,"        Function Create-MigrationSchedule(){","                param(","                    [string]$InputBatchesFile ","                )","\t            try{","                    If(-not (Test-Path $InputBatchesFile)){","                        throw [System.IO.FileNotFoundException] \"$($InputBatchesFile) file not found.\"","                    }","                    $usersFromBatch = import-csv $InputBatchesFile","                    \"Migration Date(MM/dd/yyyy),Migration Window,Migration Group,PrimarySMTPAddress,SuggestedBatch,MailboxSize(MB),Notes\" \u003e $Script:MigrationScheduleFile","                    $userInfo = New-Object System.Text.StringBuilder","                    Write-LogEntry -LogName:$Script:LogFile -LogEntryText \"Number of users in the migration schedule: $($usersFromBatch.Count)\" -ForegroundColor White","","                    $usersFromBatchCounter = 0","                    foreach($item in $usersFromBatch){","                        $usersFromBatchCounter++","                        $usersFromBatchRemaining = $usersFromBatch.count - $usersFromBatchCounter","                        Write-Progress -Activity \"Step 3 of 3: Creating migration schedule\" -status \"Items remaining: $($usersFromBatchRemaining)\" -percentComplete (($usersFromBatchCounter / $usersFromBatch.count)*100)","","                       #Check if using UseImportCSVFile and if yes, check if the user was part of that file, otherwise mark ","                       $isUserPartOfInitialCSVFile = \"\"","                       If($Script:InputMailboxesCSV -ne \"\"){","                        If(-not ($Script:ListOfMailboxes.PrimarySMTPAddress -contains $item.user)){","                            $isUserPartOfInitialCSVFile = \"User was not part of initial csv file\"","                        }","                       }","","                       $user = get-user $item.user #-erroraction SilentlyContinue","\t\t   ","                       If(![string]::IsNullOrEmpty($user.