"Error: $($_) at $($_.InvocationInfo.ScriptLineNumber)\" -ForegroundColor Red","                }","            }","","        Function CleanUp-PreviousRun() {","            try{","                If(test-path $PermsOutputFile){Remove-item -path $PermsOutputFile}","                If(test-path $BatchesFile){Remove-item -path $BatchesFile} ","                If(test-path $MigrationScheduleFile){Remove-item -path $MigrationScheduleFile}","                #$ProgressXMLFile doesn't have to be wiped since this is recreated every time","                Write-LogEntry -LogName:$LogFile -LogEntryText \"Successfully cleaned up previous run results.\"","            }","            catch{","                Write-LogEntry -LogName:$LogFile -LogEntryText \"Unable to clean up csv outputs from previous run. This needs to be done to avoid mixed results. ERROR=$($_) \" -ForegroundColor Red","                exit","            }","        }","        #endregion functions","","        #Script Variables","        $elapsed = [System.Diagnostics.Stopwatch]::StartNew()","        $scriptPath = $PSScriptRoot","        $yyyyMMdd = Get-Date -Format 'yyyyMMdd'","        $LogFile = \"$scriptPath\\Find-MailboxDelegates-$yyyyMMdd.log\"","        $PermsOutputFile = \"$scriptPath\\Find-MailboxDelegates-Permissions.csv\"","        $BatchesFile = \"$scriptPath\\Find-MailboxDelegates-Batches.csv\"","        $MigrationScheduleFile = \"$scriptPath\\Find-MailboxDelegates-Schedule.csv\"","        $ProgressXMLFile = \"$scriptPath\\Find-MailboxDelegates-Progress.xml\"","        $Version = \"12062019\"","        $computer = $env:COMPUTERNAME","        $user = $env:USERNAME","","        $WarningPreference = \"SilentlyContinue\"","        $ErrorActionPreference = \"SilentlyContinue\"","","        \"\"","        Write-LogEntry -LogName:$LogFile -LogEntryText \"User: $user Computer: $computer ScriptVersion: $Version PowershellVersion: $($PSVersionTable.PSVersion.Major)\" -foregroundcolor Yellow","        \"\"","